package com.example.riderapp.model;import java.io.Serializable;import java.util.Date;public class Artical implements Serializable {	private String articalId;	private String title;	private String fromWhere;	private String toWhere;	private String photoUrl;	private String leader;	private Date write_date;	public Date getWrite_date() {		return write_date;	}	public void setWrite_date(Date write_date) {		this.write_date = write_date;	}	public String getLeader() {		return leader;	}	public void setLeader(String leader) {		this.leader = leader;	}	public String getArticalId() {		return articalId;	}	public void setArticalId(String articalId) {		this.articalId = articalId;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getFromWhere() {		return fromWhere;	}	public void setFromWhere(String fromWhere) {		this.fromWhere = fromWhere;	}	public String getToWhere() {		return toWhere;	}	public void setToWhere(String toWhere) {		this.toWhere = toWhere;	}	public String getPhotoUrl() {		return photoUrl;	}	public void setPhotoUrl(String photoUrl) {		this.photoUrl = photoUrl;	}}